import React from 'react'
import { Heart, ShoppingCart, User } from 'lucide-react'

const Navbar = () => {
  return (
    <header className="bg-[#FFFFFF] h-20 px-4 flex items-center justify-between">
      {/* Left side: Logo */}
      <div className="flex items-center" style={{ marginLeft: '66px' }}>
        <img src="/logo_png_1.png" alt="Logo" className="h-10" />
      </div>

      {/* Center: Menu items */}
      <nav className="flex-1 text-center space-x-8 hidden md:flex">
        <a href="#" className="text-black text-lg">Home</a>
        <a href="#" className="text-black text-lg">Store</a>
        <a href="#" className="text-black text-lg">Grooming</a>
        <a href="#" className="text-black text-lg">Contact</a>
      </nav>

      {/* Right side: Icons with margin */}
      <div className="flex items-center space-x-6 mr-10"> {/* Added margin to the right */}
        <Heart size={24} className="text-black" />
        <ShoppingCart size={24} className="text-black" />
        <User size={24} className="text-black" />
      </div>
    </header>
  )
}

export default Navbar
